import { Layout } from 'antd';
import '../styles/container.css';

const { Content } = Layout;

const Container = ({child}) => (
  <Content theme="dark" style={{ padding: '0 50px' }}>
    <div className="site-layout-content">
      {child}
      <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320"><path fill="#adadad" fill-opacity="0.9" d="M0,32L60,80C120,128,240,224,360,245.3C480,267,600,213,720,186.7C840,160,960,160,1080,160C1200,160,1320,160,1380,160L1440,160L1440,320L1380,320C1320,320,1200,320,1080,320C960,320,840,320,720,320C600,320,480,320,360,320C240,320,120,320,60,320L0,320Z"></path></svg>
    </div>
  </Content>
);

export default Container;
